import React from 'react';
import styled from 'styled-components';

const Title = styled.h1`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;

class Tomato extends React.PureComponent {
    render() {
        return (
            <div><Title>TOMATO</Title></div>
        )
    }
}
export default Tomato;
